CREATE TABLE `pro_article` (
  `id` int(10) UNSIGNED NOT NULL COMMENT '文章ID,主键且自增',
  `subject` varchar(50) NOT NULL COMMENT '文章标题',
  `image` varchar(1000) DEFAULT NULL COMMENT '文章缩略像',
  `category_id` smallint(5) UNSIGNED NOT NULL COMMENT '外键,文章分类ID',
  `author_id` int(10) UNSIGNED NOT NULL COMMENT '外键,作者ID',
  `created_at` int(10) UNSIGNED NOT NULL COMMENT '发表日期',
  `views` mediumint(9) NOT NULL DEFAULT '0' COMMENT '访问量',
  `comment` mediumint(9) NOT NULL DEFAULT '0' COMMENT '评论',
  `xihuan` mediumint(9) NOT NULL DEFAULT '0' COMMENT '点赞',
  `time` varchar(50) NOT NULL,
  `avata` varchar(1000) NOT NULL COMMENT '头像',
  `uname` varchar(256) NOT NULL COMMENT '作者名',
  `fenlei` varchar(50) NOT NULL COMMENT '分类'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

