CREATE TABLE IF NOT EXISTS `pro_author` (
  `id` mediumint(8) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '作者ID,主键且自增',
  `username` varchar(30) DEFAULT NULL COMMENT '用户名,唯一',
  `password` varchar(32) DEFAULT NULL COMMENT '密码,MD5',
  `nickname` varchar(100) DEFAULT NULL,
  `avatar` varchar(1000) NOT NULL DEFAULT 'unnamed.jpg' COMMENT '用户头像',
  `article_number` mediumint(9) NOT NULL DEFAULT '0' COMMENT '发表的文章数量',
  `position` varchar(30) DEFAULT NULL COMMENT '职位',
  `popularity` mediumint(9) DEFAULT '0' COMMENT '人气',
  `integral` mediumint(9) DEFAULT '0' COMMENT '积分',
  `fans` mediumint(9) DEFAULT '0' COMMENT '粉丝',
  `follow` mediumint(9) DEFAULT '0' COMMENT '关注',
  `uemail` varchar(50) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`)
) ENGINE=InnoDB AUTO_INCREMENT=93 DEFAULT CHARSET=utf8;

